import React from 'react';
import s from './Dialogs.module.css';
import {NavLink} from "react-router-dom";


function Message({props}) {
    return (
        <div className={s.message}>{props.message}</div>
    )
}

function DialogItem({props}) {
    let path = '/dialogs/' + props.id;
    return (
        <div className={s.dialog + ' ' + s.active}>
            <NavLink to={path}> {props.name} </NavLink>
        </div>
    )
}

const Dialogs = ({props}) => {

    let userData = [
        {"id": 1, "name": "Dmitri"},
        {"id": 2, "name": "Svetlana"},
        {"id": 2, "name": "Nauryz"},
        {"id": 4, "name": "Dinmukhamed"},
        {"id": 5, "name": "Mukhit"}
    ]

    let messageData = [
        {"message": "Yo"},
        {"message": "Hello"},
        {"message": "How are you"}
    ]

    return (
        <div className={s.dialogs}>
            <div className={s.dialogsItems}>
                <DialogItem props = {userData[0]}/>
                <DialogItem props = {userData[1]}/>
                <DialogItem props = {userData[2]}/>
                <DialogItem props = {userData[3]}/>
                <DialogItem props = {userData[4]}/>
            </div>
            <div className={s.messages}>
                <Message props = {messageData[0]}/>
                <Message props = {messageData[1]}/>
                <Message props = {messageData[2]}/>
            </div>
        </div>
    )
}

export default Dialogs;
